import './App.css';
import Header from "./Header.js"
import Desktop from "./Desktop"

function App() {
  return (
    <div className="App">
      <img
          src="art-web\src\pics\berber.png" 
          alt="berserk" 
      />
        <Header />
        <Desktop />
    </div>
  );
}

export default App;
